import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoginPage from './login'; // Adjust the path as per your file structure
import AdminPage from './admin'; // Adjust the path as per your file structure
import HomePagee from './HomePagee'; // Replace with your actual home page component

function App() {
  return (
    <Router>
      <Routes>
        {/* Route for login */}
        <Route path="/" element={<LoginPage onLoginSuccess={() => {}} />} />

        {/* Route for admin page */}
        <Route path="/admin" element={<AdminPage />} />

        {/* Route for home or dashboard */}
        <Route path="/home" element={<HomePagee />} />

        {/* Add a fallback route for 404 not found */}
        <Route path="*" element={<div>404 - Page Not Found</div>} />
      </Routes>
    </Router>
  );
}

export default App;
